@here

officially have updated immunity period on sn8 to 12000. There should be no more immunity period issues. With this change I will remove providing miners with incentive for simply responding, and incentive will only occur for providing accurate responses. **Validators shouldn’t have an issue anymore either and shouldn't use** `test_only_historical`

There is a 40 hour immunity period, and I've reduced the number of registrations per interval to 1. This will counterbalance the change I've made to extend immunity period in order to reduce the number of keys in immunity at any single point in time.

@ptn・8 I've pushed hotfix 4.0.1

there was an issue around stale results being referenced with the new weighing system. I've updated the weighing logic. Thanks @Hank for pointing out the issue!

Ill monitor for any issues with the new hotfix, if you're running the run.sh script it should auto-update. Validators will want to perform the update to stay in consensus

@ptn・8 I've pushed feature 4.1.0

mostly cleanup feature push. Updated documentation in readme, updated copyright info, removed deregd miners from local weights files to reduce memory overhead of iteration / log notifications of deregd miners during runs. 

Ill monitor for any issues with the new feature, if you're running the run.sh script it should auto-update. Validators will want to perform the update. Miners don't need to do anything.

def get_miners_with_scores(metagraph):
    weights = metagraph.W
    return {i: {"score": sum(weight), "uid": metagraph.hotkeys[i]} for i, weight in enumerate(weights.numpy())}

